DROP PROCEDURE IF EXISTS `PLOG_DESCUENTA_SALDO`$$
CREATE DEFINER=`activa11`@`localhost` PROCEDURE `PLOG_DESCUENTA_SALDO`(IN `pCliente` INT, IN `pCantidad` FLOAT(11,1), IN `pModo` CHAR(2), OUT `pResp` CHAR(200))
BEGIN
    
        DECLARE done        INT DEFAULT 0;
        DECLARE vResto      float(11,1) DEFAULT 0;
        DECLARE vCuentaSusc, vSaldoSusc,vSaldoAc,vSusc,vCodSaldo,vSaldo,vCantidad,vAdi float(11,1);
        DECLARE vImporteSaldo float(18,2);
        DECLARE vTipoPlan   CHAR(1);
        DECLARE vSuscActual, vCodSaldoActual INT;
        DECLARE cSaldos CURSOR for 
                select CODIGO_SUSCRIPCION,SALDO,TIPO_PLAN 
                  from VLOG_SALDOS_PLANES 
                 where CODIGO_CLIENTE = pCLiente 
              order by CODIGO_SUSCRIPCION;  
        DECLARE cSaldosDet CURSOR for 
                select CODIGO_SALDO,CODIGO_SUSCRIPCION,CANTIDAD, SALDO, 
                        ADICIONALES, TIPO_PLAN,IMPORTE_SALDO 
                  from VLOG_SALDOS_DET 
                 where CODIGO_CLIENTE = pCLiente 
              order by ADICIONALES DESC, CODIGO_SALDO;  
        
        DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
            
            select SALDO 
              into vSaldoAc         
              from VLOG_SALDOS         
             where CODIGO_CLIENTE = pCliente ;

            select max(CODIGO_SUSCRIPCION) ,max(CODIGO_SALDO), count(*), sum(SALDO)
              into vSuscActual, vCodSaldoActual,vCuentaSusc, vSaldoSusc
              from VLOG_SALDOS_DET  
             where CODIGO_CLIENTE = pCliente 
               and TIPO_PLAN IN ('M','A');
            IF pModo = 'D' THEN
                IF vSaldoAc < pCantidad and vCuentaSusc = 0 THEN
                    set pResp := 'El cliente no tiene saldo de gestiones suficiente';
                ELSEIF vCuentaSusc >= 1  THEN
                    /*el cliente tiene una suscripcion pero el saldo que tiene (mayor a cero) no le alcanza para la gestión.*/
                    
                    SET vResto := pCantidad;
                    OPEN cSaldosDet;        
                    REPEAT 
                    
                            FETCH cSaldosDet into vCodSaldo,vSusc,vCantidad,vSaldo,vAdi,vTipoPlan,vImporteSaldo;
                            IF NOT done THEN

                                IF vSaldo > 0 and vResto >= vSaldo and vResto > 0 THEN
                                    SET vResto := vResto - vSaldo;
                                    SET vSaldo := 0;
                                ELSEIF vSaldo > 0 and vResto <  vSaldo and vResto > 0 THEN
                                    SET vSaldo := vSaldo - vResto;
                                    SET vResto := 0;
                                END IF;
                                    update LOG_SALDO set CANTIDAD_SALDO = vSaldo 
                                     where CODIGO_CLIENTE       = pCLiente 
                                       and CODIGO_SUSCRIPCION   = vSusc
                                       AND CODIGO_SALDO         = vCodSaldo;
                                    IF vResto = 0 then
                                         SET done := 1;    
                                    END IF;
                            END IF;
                    UNTIL done END REPEAT;
                    IF vResto > 0 then
                        update LOG_SALDO SET ADICIONALES = ADICIONALES+vResto,
                                                        IMPORTE_SALDO = IMPORTE_SALDO+(IMPORTE/CANTIDAD*vResto)
                        where CODIGO_CLIENTE = pCLiente 
                          and CODIGO_SUSCRIPCION = vSuscActual
                          AND CODIGO_SALDO = vCodSaldoActual;
                        
                    END IF;
                    SET pResp := 'OK';

                ELSEIF vSaldoAc >= pCantidad THEN
                    SET vResto := pCantidad;
                    OPEN cSaldosDet;        
                    REPEAT 
                            
                            FETCH cSaldosDet into vCodSaldo,vSusc,vCantidad,vSaldo,vAdi,vTipoPlan,vImporteSaldo;
                            IF NOT done THEN

                                IF vSaldo > 0 and vResto >= vSaldo and vResto > 0 THEN
                                    SET vResto := vResto - vSaldo;
                                    SET vSaldo := 0;
                                ELSEIF vSaldo > 0 and vResto <  vSaldo and vResto > 0 THEN
                                    SET vSaldo := vSaldo - vResto;
                                    SET vResto := 0;
                                END IF;
                                    update LOG_SALDO set CANTIDAD_SALDO = vSaldo 
                                     where CODIGO_CLIENTE       = pCLiente 
                                       and CODIGO_SUSCRIPCION   = vSusc
                                       AND CODIGO_SALDO         = vCodSaldo;
                                    IF vResto = 0 then
                                         SET done := 1;    
                                    END IF;
                            END IF;
                    UNTIL done END REPEAT;
                    SET pResp := 'OK';
                END IF;



            ELSEIF pModo = 'A' THEN /*AUMENTA EL SALDO EN CASO DE REVERSION*/
                SET vResto := pCantidad;
                OPEN cSaldosDet;        
                REPEAT 
                    FETCH cSaldosDet into vCodSaldo,vSusc,vCantidad,vSaldo,vAdi,vTipoPlan,vImporteSaldo;
                        IF NOT done THEN
                                
                                IF vAdi > 0 and vAdi < vResto  and vImporteSaldo > 0 THEN       
                                /*SI TUVO ADICIONALES PERO TUVO MENOS DE LO QUE ESTA DESCONTANDO*/
                                    SET vResto = vResto - vAdi;
                                    update LOG_SALDO set ADICIONALES = 0,
                                                         IMPORTE_SALDO = IMPORTE_SALDO-((IMPORTE/CANTIDAD)*vAdi)
                                     where CODIGO_CLIENTE = pCLiente 
                                       and CODIGO_SALDO = vCodSaldo;
                                    IF (vCantidad-vSaldo) < vResto  THEN
                                        SET vResto = vResto - (vCantidad-vSaldo);
                                        update LOG_SALDO set CANTIDAD_SALDO = vCantidad 
                                         where CODIGO_CLIENTE = pCLiente 
                                           and CODIGO_SALDO = vCodSaldo;
                                    ELSEIF (vCantidad-vSaldo) >= vResto  and vImporteSaldo > 0 THEN
                                        update LOG_SALDO set CANTIDAD_SALDO = CANTIDAD_SALDO+vResto 
                                         where CODIGO_CLIENTE = pCLiente 
                                           and CODIGO_SALDO = vCodSaldo;
                                        SET vResto = 0;
                                    END IF;
                                ELSEIF vAdi > 0 and vAdi >= vResto and vImporteSaldo > 0 THEN 
                                /*SI TUVO ADICIONALES Y TUVO MAYOR O IGUAL A LO QUE ESTA DESCONTANDO*/
                                    update LOG_SALDO set ADICIONALES = ADICIONALES-vResto,
                                                         IMPORTE_SALDO = IMPORTE_SALDO-((IMPORTE/CANTIDAD)*vResto)
                                     where CODIGO_CLIENTE = pCLiente 
                                       and CODIGO_SALDO = vCodSaldo;
                                     SET vResto = 0;
                                ELSEIF (vCantidad-vSaldo) < vResto and vImporteSaldo > 0 THEN
                                            SET vResto = vResto - (vCantidad-vSaldo);
                                            update LOG_SALDO set CANTIDAD_SALDO = vCantidad 
                                             where CODIGO_CLIENTE = pCLiente 
                                               and CODIGO_SALDO = vCodSaldo;                                        
                                ELSEIF (vCantidad-vSaldo) >= vResto  and vImporteSaldo > 0 THEN
                                    update LOG_SALDO set CANTIDAD_SALDO = CANTIDAD_SALDO+vResto 
                                      where CODIGO_CLIENTE = pCLiente 
                                        and CODIGO_SALDO = vCodSaldo;
                                    SET vResto = 0;
                                END IF;
                                IF vResto = 0 then
                                     SET done := 1;
                                END IF;
                        END IF;
                UNTIL done END REPEAT;
            END IF;
END$$

DROP PROCEDURE IF EXISTS `P_GENERA_SALDO_MENSUAL`$$
CREATE DEFINER=`activa11`@`localhost` PROCEDURE `P_GENERA_SALDO_MENSUAL`()
    NO SQL
BEGIN

SELECT MAX(A.CODIGO_SUSCRIPCION), 
A.CODIGO_CLIENTE, 
P.CANTIDAD_PLAN, P.CANTIDAD_PLAN, 0 ADICIONALES,
CONCAT(YEAR(NOW()),'-',MONTH(NOW()),'-01') FECHA_SALDO, 
LAST_DAY(DATE_ADD(cast(now() as date), INTERVAL 1 MONTH)) FECHA_SALDO_VTO,
P.COSTO_PLAN ,P.COSTO_PLAN,'S' AUTOGEN

FROM ADM_SUSCRIPCIONES A, ADM_PLANES P 
WHERE A.ESTADO_SUSCRIPCION = 'A'
AND A.CODIGO_PLAN = P.CODIGO_PLAN
AND P.TIPO_PLAN = 'A'
AND A.CODIGO_SUSCRIPCION = (SELECT MAX(CODIGO_SUSCRIPCION) 
                            FROM ADM_SUSCRIPCIONES M, ADM_PLANES N
                           WHERE M.CODIGO_CLIENTE = A.CODIGO_CLIENTE
                             AND M.ESTADO_SUSCRIPCION = 'A'
                            AND M.CODIGO_PLAN = N.CODIGO_PLAN
                            AND N.TIPO_PLAN  = 'A'
                              )
AND NOT EXISTS (SELECT 1 FROM LOG_SALDO L
               WHERE L.CODIGO_SUSCRIPCION = A.CODIGO_SUSCRIPCION
                 AND L.FECHA_SALDO>= CONCAT(YEAR(NOW()),'-',MONTH(NOW()),'-01') )

GROUP BY A.CODIGO_CLIENTE,P.COSTO_PLAN,P.COSTO_PLAN,P.CANTIDAD_PLAN, P.CANTIDAD_PLAN 
;


SELECT MAX(A.CODIGO_SUSCRIPCION), 
A.CODIGO_CLIENTE, 
P.CANTIDAD_PLAN, P.CANTIDAD_PLAN, 0 ADICIONALES,
CONCAT(YEAR(NOW()),'-',MONTH(NOW()),'-01') FECHA_SALDO, 
LAST_DAY(DATE_ADD(cast(now() as date), INTERVAL 1 MONTH)) FECHA_SALDO_VTO,
P.COSTO_PLAN ,P.COSTO_PLAN,'S' AUTOGEN

FROM ADM_SUSCRIPCIONES A, ADM_PLANES P 
WHERE A.ESTADO_SUSCRIPCION = 'A'
AND A.CODIGO_PLAN = P.CODIGO_PLAN
AND P.TIPO_PLAN = 'M'
AND A.CODIGO_SUSCRIPCION = (SELECT MAX(CODIGO_SUSCRIPCION) 
                            FROM ADM_SUSCRIPCIONES M, ADM_PLANES N
                           WHERE M.CODIGO_CLIENTE = A.CODIGO_CLIENTE
                             AND M.ESTADO_SUSCRIPCION = 'A'
                            AND M.CODIGO_PLAN = N.CODIGO_PLAN
                            AND N.TIPO_PLAN  = 'M'
                              )
AND NOT EXISTS (SELECT 1 FROM LOG_SALDO L
               WHERE L.CODIGO_SUSCRIPCION = A.CODIGO_SUSCRIPCION
                 AND L.FECHA_SALDO>= CONCAT(YEAR(NOW()),'-',MONTH(NOW()),'-01') )

GROUP BY A.CODIGO_CLIENTE,P.COSTO_PLAN,P.COSTO_PLAN,P.CANTIDAD_PLAN, P.CANTIDAD_PLAN 
;

END$$

