DROP FUNCTION IF EXISTS `F_TRAE_SALDOS`$$
CREATE DEFINER=`activa11`@`localhost` FUNCTION `F_TRAE_SALDOS`(`P_CLIENTE` INT, `P_PERIODO` VARCHAR(7), `P_TIPO` INT) RETURNS float(18,1)
    NO SQL
BEGIN
DECLARE VRESUL FLOAT(12,1);
IF P_TIPO = 1 THEN   /*TRAE SALDO DE SUSCRIPCION MENSUAL MES ANTERIOR*/
	SET VRESUL    := (select SUM(`s`.`CANTIDAD_SALDO`)  from ((((`activa11_sistema_bck`.`LOG_SALDO` `s` join `activa11_sistema_bck`.`ADM_CLIENTES` `c`) join `activa11_sistema_bck`.`ADM_PERSONAS` `p`) join `activa11_sistema_bck`.`ADM_SUSCRIPCIONES` `u`) join `activa11_sistema_bck`.`ADM_PLANES` `l`) 
		where ((`s`.`CODIGO_SUSCRIPCION` = `u`.`CODIGO_SUSCRIPCION`) 
			and (`u`.`CODIGO_PLAN` = `l`.`CODIGO_PLAN`) 
			AND (`l`.`TIPO_PLAN` IN ('A','M') )
			and (`s`.`CODIGO_CLIENTE` = `c`.`CODIGO_CLIENTE`)
			AND (`s`.`CODIGO_CLIENTE` = P_CLIENTE)
			AND `s`.`FECHA_SALDO` <= LAST_DAY(DATE_ADD(concat(P_PERIODO,'-01'), INTERVAL -1 MONTH))
			and (`c`.`CODIGO_PERSONA` = `p`.`CODIGO_PERSONA`) 
			and (`u`.`ESTADO_SUSCRIPCION` = 'A') 
			and (`s`.`FECHA_SALDO_VTO` >= cast(now() as date))
			) 
	order by `s`.`CODIGO_SALDO` );
ELSEIF P_TIPO = 2 THEN /*TRAE SALDO DE SUSCRIPCION MENSUAL MES ACTUAL*/
  SET VRESUL    := (select SUM(`s`.`CANTIDAD_SALDO`)  
					from ((((`activa11_sistema_bck`.`LOG_SALDO` `s` 
						join `activa11_sistema_bck`.`ADM_CLIENTES` `c`) 
						join `activa11_sistema_bck`.`ADM_PERSONAS` `p`) 
						join `activa11_sistema_bck`.`ADM_SUSCRIPCIONES` `u`) 
						join `activa11_sistema_bck`.`ADM_PLANES` `l`) 
					where ((`s`.`CODIGO_SUSCRIPCION` = `u`.`CODIGO_SUSCRIPCION`) 
				   	and (`u`.`CODIGO_PLAN` = `l`.`CODIGO_PLAN`) 
				   	AND (`l`.`TIPO_PLAN` IN ('A','M') )
					and (`s`.`CODIGO_CLIENTE` = `c`.`CODIGO_CLIENTE`)
					AND (`s`.`CODIGO_CLIENTE` = P_CLIENTE)
					AND `s`.`FECHA_SALDO` >= DATE_ADD(concat(P_PERIODO,'-01'), INTERVAL 0 MONTH)
					and (`c`.`CODIGO_PERSONA` = `p`.`CODIGO_PERSONA`) 
					and (`u`.`ESTADO_SUSCRIPCION` = 'A') 
					and (`s`.`FECHA_SALDO_VTO` >= cast(now() as date))) 
				order by `s`.`CODIGO_SALDO` );
ELSEIF P_TIPO = 3 THEN   /*TRAE SALDO DE SUSCRIPCION CASUAL MES ANTERIOR*/
	SET VRESUL    := (select SUM(`s`.`CANTIDAD_SALDO`)  from ((((`activa11_sistema_bck`.`LOG_SALDO` `s` join `activa11_sistema_bck`.`ADM_CLIENTES` `c`) join `activa11_sistema_bck`.`ADM_PERSONAS` `p`) join `activa11_sistema_bck`.`ADM_SUSCRIPCIONES` `u`) join `activa11_sistema_bck`.`ADM_PLANES` `l`) 
		where ((`s`.`CODIGO_SUSCRIPCION` = `u`.`CODIGO_SUSCRIPCION`) 
			and (`u`.`CODIGO_PLAN` = `l`.`CODIGO_PLAN`) 
			AND (`l`.`TIPO_PLAN` IN ('C') )
			and (`s`.`CODIGO_CLIENTE` = `c`.`CODIGO_CLIENTE`)
			AND (`s`.`CODIGO_CLIENTE` = P_CLIENTE)
			AND `s`.`FECHA_SALDO` <= LAST_DAY(DATE_ADD(concat(P_PERIODO,'-01'), INTERVAL -1 MONTH))
			and (`c`.`CODIGO_PERSONA` = `p`.`CODIGO_PERSONA`) 
			and (`u`.`ESTADO_SUSCRIPCION` = 'A') 
			and (`s`.`FECHA_SALDO_VTO` >= cast(now() as date))
			) 
	order by `s`.`CODIGO_SALDO` );
ELSEIF P_TIPO = 4 THEN /*TRAE SALDO DE SUSCRIPCION CASUAL MES ACTUAL*/
  SET VRESUL    := (select SUM(`s`.`CANTIDAD_SALDO`)  
					from ((((`activa11_sistema_bck`.`LOG_SALDO` `s` 
						join `activa11_sistema_bck`.`ADM_CLIENTES` `c`) 
						join `activa11_sistema_bck`.`ADM_PERSONAS` `p`) 
						join `activa11_sistema_bck`.`ADM_SUSCRIPCIONES` `u`) 
						join `activa11_sistema_bck`.`ADM_PLANES` `l`) 
					where ((`s`.`CODIGO_SUSCRIPCION` = `u`.`CODIGO_SUSCRIPCION`) 
				   	and (`u`.`CODIGO_PLAN` = `l`.`CODIGO_PLAN`) 
				   	AND (`l`.`TIPO_PLAN` = ('C') )
					and (`s`.`CODIGO_CLIENTE` = `c`.`CODIGO_CLIENTE`)
					AND (`s`.`CODIGO_CLIENTE` = P_CLIENTE)
					AND `s`.`FECHA_SALDO` >= DATE_ADD(concat(P_PERIODO,'-01'), INTERVAL 0 MONTH)
					and (`c`.`CODIGO_PERSONA` = `p`.`CODIGO_PERSONA`) 
					and (`u`.`ESTADO_SUSCRIPCION` = 'A') 
					and (`s`.`FECHA_SALDO_VTO` >= cast(now() as date))) 
				order by `s`.`CODIGO_SALDO` );
END IF;
   RETURN IFNULL(VRESUL,0);
END$$

