DROP TRIGGER IF EXISTS `DESCUENTA_IMPORTE_SALDO`;
DELIMITER $$
CREATE TRIGGER `DESCUENTA_IMPORTE_SALDO` AFTER INSERT ON `ADM_FACTURA_VENTA_DET`
 FOR EACH ROW BEGIN
  UPDATE LOG_SALDO L SET L.IMPORTE_SALDO = L.IMPORTE_SALDO-NEW.IMPORTE
WHERE L.CODIGO_SALDO = NEW.CODIGO_SALDO;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `DEVUELVE_IMPORTE_SALDO`;
DELIMITER $$
CREATE TRIGGER `DEVUELVE_IMPORTE_SALDO` AFTER DELETE ON `ADM_FACTURA_VENTA_DET`
 FOR EACH ROW BEGIN
  UPDATE LOG_SALDO L SET L.IMPORTE_SALDO = L.IMPORTE_SALDO+OLD.IMPORTE
WHERE L.CODIGO_SALDO = OLD.CODIGO_SALDO;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `MODIFICA_IMPORTE_SALDO`;
DELIMITER $$
CREATE TRIGGER `MODIFICA_IMPORTE_SALDO` AFTER UPDATE ON `ADM_FACTURA_VENTA_DET`
 FOR EACH ROW BEGIN
UPDATE LOG_SALDO L SET L.IMPORTE_SALDO = L.IMPORTE_SALDO+OLD.IMPORTE
WHERE L.CODIGO_SALDO = OLD.CODIGO_SALDO;

  UPDATE LOG_SALDO L SET L.IMPORTE_SALDO = L.IMPORTE_SALDO-NEW.IMPORTE
WHERE L.CODIGO_SALDO = NEW.CODIGO_SALDO;

END
$$
