--
-- Disparadores `ADM_SUSCRIPCIONES`
--
DROP TRIGGER IF EXISTS `INSERTA_LOG_SALDO`;
DELIMITER $$
CREATE TRIGGER `INSERTA_LOG_SALDO` AFTER INSERT ON `ADM_SUSCRIPCIONES`
 FOR EACH ROW BEGIN
  DECLARE MONTO_PLAN INT;
  DECLARE CANTIDAD_PLAN INT;
  
  SET MONTO_PLAN =  (SELECT PL.COSTO_PLAN FROM ADM_PLANES PL WHERE PL.CODIGO_PLAN = NEW.CODIGO_PLAN);
  SET CANTIDAD_PLAN =  (SELECT PL.CANTIDAD_PLAN FROM ADM_PLANES PL WHERE PL.CODIGO_PLAN = NEW.CODIGO_PLAN);
  
	VALUES (NULL, NEW.CODIGO_SUSCRIPCION, NEW.CODIGO_CLIENTE, NEW.FECHA_SUSCRIPCION, NEW.FECHA_VENCIMIENTO, CANTIDAD_PLAN, CANTIDAD_PLAN, MONTO_PLAN, MONTO_PLAN); 
	
	
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `MODIFICA_LOG_SALDO`;
DELIMITER $$
CREATE TRIGGER `MODIFICA_LOG_SALDO` AFTER UPDATE ON `ADM_SUSCRIPCIONES`
 FOR EACH ROW BEGIN
  DECLARE VMONTO_PLAN INT;
  DECLARE VCANTIDAD_PLAN INT;
  DECLARE VCOD_SALDO_MAX INT;
  DECLARE VUSADO FLOAT(5,1);
  DECLARE VFACTURADO FLOAT(18,2);

	
  SET VCOD_SALDO_MAX = (SELECT MAX(CODIGO_SALDO) FROM LOG_SALDO S WHERE S.CODIGO_SUSCRIPCION = NEW.CODIGO_SUSCRIPCION);
  SET VUSADO = (SELECT (S.CANTIDAD-S.CANTIDAD_SALDO)
  				  FROM LOG_SALDO S 
  				 WHERE S.CODIGO_SALDO = VCOD_SALDO_MAX);

  SET VFACTURADO = (SELECT (S.IMPORTE-S.IMPORTE_SALDO)
  				  FROM LOG_SALDO S 
  				 WHERE S.CODIGO_SALDO = VCOD_SALDO_MAX);
  
  
  SET VMONTO_PLAN =  (SELECT PL.COSTO_PLAN FROM ADM_PLANES PL WHERE PL.CODIGO_PLAN = NEW.CODIGO_PLAN);
  SET VCANTIDAD_PLAN =  (SELECT PL.CANTIDAD_PLAN FROM ADM_PLANES PL WHERE PL.CODIGO_PLAN = NEW.CODIGO_PLAN);
  
  UPDATE LOG_SALDO SET CANTIDAD = VCANTIDAD_PLAN,
  					   CANTIDAD_SALDO = (IFNULL(VCANTIDAD_PLAN,0)-(VUSADO)),
  					   IMPORTE  = VMONTO_PLAN,
  					   IMPORTE_SALDO = VMONTO_PLAN -(VFACTURADO)
       WHERE CODIGO_SALDO =  VCOD_SALDO_MAX;

   
END
$$
DELIMITER ;

