DROP TRIGGER IF EXISTS `DESCUENTA_SALDO`;
DELIMITER $$
CREATE TRIGGER `DESCUENTA_SALDO` AFTER INSERT ON `LOG_GESTIONES`
 FOR EACH ROW BEGIN
  DECLARE vResp char(200);
  IF IFNULL(NEW.GENTILEZA,'N') = 'N' THEN 
  call PLOG_DESCUENTA_SALDO (New.CODIGO_CLIENTE,NEW.CANTIDAD_GESTIONES,'D',vResp);
  END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `RETORNA_SALDO`;
DELIMITER $$
CREATE TRIGGER `RETORNA_SALDO` AFTER UPDATE ON `LOG_GESTIONES`
 FOR EACH ROW BEGIN
  DECLARE CODIGO_SUSCRIPCION INT;
  DECLARE DIFERENCIA FLOAT(11,1);
  DECLARE vResp char(200);
 
															
		SET DIFERENCIA = (NEW.CANTIDAD_GESTIONES - OLD.CANTIDAD_GESTIONES); 
	 
		IF NEW.ESTADO = 'A' AND OLD.ESTADO <> 'A' AND  IFNULL(NEW.GENTILEZA,'N') = 'N' THEN
   			
			call PLOG_DESCUENTA_SALDO (New.CODIGO_CLIENTE,NEW.CANTIDAD_GESTIONES,'D',vResp);

        ELSEIF OLD.ESTADO = 'A' AND NEW.ESTADO <> 'A' AND  IFNULL(OLD.GENTILEZA,'N') = 'N' THEN

        	call PLOG_DESCUENTA_SALDO (New.CODIGO_CLIENTE,OLD.CANTIDAD_GESTIONES,'A',vResp);

		ELSEIF NEW.GENTILEZA = 'N' AND OLD.GENTILEZA = 'S' AND  NEW.ESTADO = 'A'  THEN 

  					call PLOG_DESCUENTA_SALDO 	(New.CODIGO_CLIENTE,NEW.CANTIDAD_GESTIONES,'D',vResp);
		ELSEIF NEW.GENTILEZA = 'S' AND OLD.GENTILEZA = 'N' AND  OLD.ESTADO = 'A' AND NEW.ESTADO = 'A' THEN 

  					call PLOG_DESCUENTA_SALDO 	(OLD.CODIGO_CLIENTE,OLD.CANTIDAD_GESTIONES,'A',vResp);
  
		ELSEIF NEW.ESTADO = 'A' AND IFNULL(NEW.GENTILEZA,'N') = 'N' THEN
			IF DIFERENCIA < 0 THEN		
				call PLOG_DESCUENTA_SALDO (New.CODIGO_CLIENTE,(DIFERENCIA*-1),'A',vResp);	
		    ELSEIF DIFERENCIA > 0 THEN
				call PLOG_DESCUENTA_SALDO (New.CODIGO_CLIENTE,(DIFERENCIA),'D',vResp);
			END IF;
		END IF;





END
$$
DELIMITER ;

