DROP TRIGGER IF EXISTS `ACTUALIZA_SYNC_APP`;
DELIMITER $$
CREATE TRIGGER `ACTUALIZA_SYNC_APP` BEFORE UPDATE ON `LOG_GESTIONES_ACT`
 FOR EACH ROW BEGIN
DECLARE VMAX_SYNC INTEGER;
IF NEW.CODIGO_GESTION <> OLD.CODIGO_GESTION OR
   NEW.CODIGO_ZONA <> OLD.CODIGO_ZONA OR

    NEW.DESCRIPCION <> OLD.DESCRIPCION OR 
    NEW.ORDEN <> OLD.ORDEN OR 
    NEW.PROCESO <> OLD.PROCESO OR 
    NEW.DESTINO <> OLD.DESTINO THEN
   SET NEW.SYNC = 2 ;

/*Actualiza Log gestiones ACt Sync*/
 
        SET VMAX_SYNC = (SELECT MAX(ORDEN)+1 FROM LOG_GESTIONES_ACT_SYNC S 
                         WHERE S.CODIGO_GESTION = NEW.CODIGO_GESTION);
        IF VMAX_SYNC IS NULL THEN
           SET VMAX_SYNC = 1;
        END IF;


          VALUES (NEW.CODIGO_GESTION,2,NEW.ORDEN);


END IF;  

  
END
$$
DELIMITER ;
