CREATE TRIGGER `ACTUALIZA_SYNC_APP_ON_DELETE` BEFORE DELETE ON `LOG_GESTIONES_ACT`
 FOR EACH ROW BEGIN
          VALUES (OLD.CODIGO_GESTION,OLD.ORDEN,3);  
END
$$
DELIMITER ;

